        ];
    }

    public function keysToIdc(array $keys): array
    {
        $tmp = [];
        for($i=0;$i<count($keys);$i++) {
            $tmp[] = array_search($keys[$i], self::MAIN_MOCK_KEYS, false);
        }

        return $tmp;
    }
